import { NavLink } from "react-router-dom";

const link =
    "px-3 py-2 rounded-md text-sm font-medium hover:bg-black/5 transition-colors";
const active = "text-primary underline";

export default function Nav() {
    return (
        <header className="border-b border-black/5 bg-white/80 backdrop-blur">
            <div className="mx-auto max-w-6xl px-4 py-4 flex items-center justify-between">
                <div className="flex items-center gap-4">
                    <img
                        src="/images/centum-logo.png"
                        alt="CENTUM Financial Group"
                        className="h-12 w-auto"
                        onError={(e) => {
                            e.target.style.display = 'none';
                            e.target.nextSibling.style.display = 'flex';
                        }}
                    />
                    <div className="size-10 rounded-xl bg-gradient-to-br from-red-500 to-red-600 flex items-center justify-center shadow-lg" style={{ display: 'none' }}>
                        <span className="text-white font-black text-lg">C</span>
                    </div>
                    <div className="leading-tight">
                        <p className="font-bold text-gray-900">Anne Brill</p>
                        <p className="text-xs text-slate-600 font-medium">M08005655 â€¢ CENTUM Financial</p>
                    </div>
                </div>

                <nav className="hidden md:flex items-center gap-1">
                    <NavLink to="/" className={({ isActive }) => `${link} ${isActive ? active : ""}`}>Home</NavLink>
                    <NavLink to="/calculators/payment" className={({ isActive }) => `${link} ${isActive ? active : ""}`}>Payment</NavLink>
                    <NavLink to="/calculators/affordability" className={({ isActive }) => `${link} ${isActive ? active : ""}`}>Affordability</NavLink>
                    <NavLink to="/calculators/rent-vs-buy" className={({ isActive }) => `${link} ${isActive ? active : ""}`}>Rent vs Buy</NavLink>
                    <NavLink to="/book" className={({ isActive }) => `${link} ${isActive ? active : ""}`}>Book</NavLink>
                    <NavLink to="/pre-approval" className={({ isActive }) => `${link} ${isActive ? active : ""}`}>Pre-Approval</NavLink>
                </nav>

                <a href="/pre-approval" className="btn btn-primary hidden md:inline-flex">Get Pre-Approved</a>
            </div>
        </header>
    );
}
